import React from "react";
import "./Footer.css";

const Footer = (props) => {
  const renderBaubles = this.props.socialMediaBaubles.map((item) => {
    return (
      <div className="baubles-item">
        <Bauble referenceLink={item.referenceLink} ionicon={item.ionicon} />
      </div>
    );
  });

  return (
    <footer>
      <p>Copyright &copy; 2021 by DLSU GDG. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
